import React from "react"
import { FieldArray } from 'formik'

type InputProps = {
  rest: {
    id: string
    type: string
    label: string
  }
}

const InputGroup = ({ rest }) => {
  const { id, type, label } = rest


  return <div>
    <FieldArray
      name={ id }
      render={props => (
        <div>
          // @ts-ignore
          {console.log(props)}
        </div>
        )
      }
    />
  </div>
}

export default InputGroup
